(function() {

    var image = "base64,";
    var imgs = document.getElementsByTagName("img");
    var _pattern = /.*whale_error\.gif/g;
    for (var i = 0; i < imgs.length; i++) {
        var _src = imgs[i].src;
        if (_src.match(_pattern)) {
            imgs[i].src = "data:image/gif;" + image;
        } 
    }

})();